resources.string:
Το Olvid ID σου διαχειρίζεται επί του παρόντος ο πάροχος ταυτότητας της εταιρείας σου. Είσαι έτοιμος να μεταβείς σε ένα κανονικό, μη διαχειριζόμενο Olvid ID.

Εάν συνεχίσεις, δεν θα μπορείς πλέον να προσθέτεις απρόσκοπτα επαφές από την εταιρεία σου στο Olvid. Επικοινώνησε με τον διαχειριστή σου για περισσότερες λεπτομέρειες.

Θέλεις να συνεχίσεις;

Η ομάδα %1$s περιέχει μέλη με τα οποία δεν έχετε ακόμη ασφαλές κανάλι. Δεν μπορείτε να τους προσκαλέσετε στη νέα ομάδα.

Επηρεαζόμενοι χρήστες:%2$s

Επιθυμείτε να συνεχίσετε με μια ελλιπή ομάδα;
